import React from "react";
import { Card, Icon, Avatar } from "antd";

const { Meta } = Card;

const ReservationList = ({ data, date }) => {
  return (
    <Card
      title="reservation"
      style={{ width: 300 }}
      cover={
        <img
          alt=""
          src="https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png"
        />
      }
      action={[
        <Icon type="delete" onClick={() => console.log("deleted")} />,
        <Icon type="edit" onClick={() => console.log("edited")} />
      ]}
    >
      <Meta></Meta>
    </Card>
  );
};

export default ReservationList;
